import React from "react";
import Logo from './logo'
/* Importar los componentes */

/* Importar los iconos */

export default function Navbar(props) {
  alert (props);
  return <div className="navbar">
  <Logo 
    logo={props.logo}
  />
  <SearchBar 
    image={imgBar}
  />
  <SmIcon 
    iconUrl={iconVideo}
  />
  <SmIcon 
    iconUrl={iconModule}
  />
  <SmIcon 
    iconUrl={iconBell}
  />
  <Login 
    image={imgLogin}
  />
</div>;
}
